const Hobbies = () => {
    return (
        <div>
            <h2>Hobbies</h2>
            <p>
                I enjoy playing guitar, golfing, and video games. In the future, I would like to explore hiking and climbing.
            </p>
        </div>
    );
};

export default Hobbies;
